import { CreateOutlined } from '@mui/icons-material';
import { Box, Button, styled } from '@mui/material';
import React from 'react';

const SideBarContent = () => {
  return (
    <Box>
      <Button>
        <CreateOutlined /> Compose
      </Button>
      <Box></Box>
    </Box>
  );
};

export default SideBarContent;
